import './CSS/EmployeeNominationCSS.css'

export default function Nominee (){
    return (
        <div class="container">
        <img class="photo" alt="Profile Picture" src="PIC/profilePicture.jpg" />
        <div class="info">
          <h4>Mohamed Tarek 1</h4>
          <small>Nominated by: Mohamed Tarek</small>
        </div>
      </div>
    );
}
